import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import "bootstrap/dist/css/bootstrap.min.css"; // Importa Bootstrap

const EditarPremio = () => {
  const { id } = useParams();  // Obtener el id del premio de la URL
  const navigate = useNavigate();  // Para redirigir a otra página después de editar
  const [premio, setPremio] = useState({
    tipo: '',
    descripcion: '',
    marca: '',
    proveedor: {
      nombre: '',
      apellido: ''
    }
  });

  useEffect(() => {
    const fetchPremio = async () => {
      try {
        const response = await fetch(`http://localhost:5000/api/premios/${id}`);
        const data = await response.json();
        setPremio(data);
      } catch (err) {
        alert('Error al cargar el premio');
      }
    };

    fetchPremio();
  }, [id]);

  // Actualización del estado
  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name === 'nombreProveedor' || name === 'apellidoProveedor') {
      setPremio(prevState => ({
        ...prevState,
        proveedor: {
          ...prevState.proveedor,
          [name]: value
        }
      }));
    } else {
      setPremio(prevState => ({
        ...prevState,
        [name]: value
      }));
    }
  };

  // Envío del formulario para actualizar el premio
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch(`http://localhost:5000/api/premios/${id}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(premio),
      });

      if (response.ok) {
        alert('Premio actualizado con éxito');
        navigate('/premios');  // Redirige a la lista de premios
      } else {
        alert('Error al actualizar el premio');
      }
    } catch (err) {
      alert('Error al actualizar el premio');
    }
  };

  return (
    <div className="container mt-5">
      <h3 className="text-center mb-4">Editar Premio</h3>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Tipo</label>
          <select
            className="form-select"
            name="tipo"
            value={premio.tipo}
            onChange={handleChange}
            required
          >
            <option value="efectivo">Efectivo</option>
            <option value="obsequio">Obsequio</option>
          </select>
        </div>
        <div className="mb-3">
          <label className="form-label">Descripción</label>
          <input
            type="text"
            className="form-control"
            name="descripcion"
            value={premio.descripcion}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Marca</label>
          <input
            type="text"
            className="form-control"
            name="marca"
            value={premio.marca}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Nombre del Proveedor</label>
          <input
            type="text"
            className="form-control"
            name="nombreProveedor"
            value={premio.proveedor.nombre}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Apellido del Proveedor</label>
          <input
            type="text"
            className="form-control"
            name="apellidoProveedor"
            value={premio.proveedor.apellido}
            onChange={handleChange}
            required
          />
        </div>
        <button type="submit" className="btn btn-primary">Actualizar Premio</button>
      </form>
    </div>
  );
};

export default EditarPremio;
